import React from 'react'
import LinearProgress from '@mui/material/LinearProgress';

const Skill = ({title, level}) => {
  return (
    <div>
        <h5>{title}</h5>
        <LinearProgress variant="determinate" value={level}/>
    </div>
  )
}

export default Skill
